INSERT INTO `ca_monitoreo_asesor` (`id`, `id_agenda_monitoreo`, `id_asesor`, `id_analista`, `fecha_llamada`, `hora_llamada`, `tipificacion`, `id_llamada`, `observacion`, `solucion`, `fallas_audio`, `fecha_registro`, `fecha_modificaicon`) VALUES
	(1, 1, 14, 4, '2018-09-27', '17:36:00', 1, '25910223', ' Se comunica la Sra. Maria Cristina NiÃ±o solicitando Diovan 80mg * 28 caps, cetirizina 5 mg *10 tabs. Con numero de cÃ©dula 51696940. El Asesor realiza confirmaciÃ³n de datos, agradece los tiempos de espera, gestiÃ³n comercial de productos correcta, hace solicitud de bolsa, confirma valor, hace gestiÃ³n de OAI. Asesor tiene buen tono de llamada, y una asertiva gestiÃ³n  y comunicaciÃ³n con el usuario, maneja la llamada de forna adecuada. OM: Se sugiere realizar confirmaciÃ³n de pedido  a manera de resumen antes de finalizar la llamada. NOTA: 0/100\r\n', 1, 4, '2018-09-28 11:05:39', '2018-10-11 12:03:36'),
	(2, 2, 38, 4, '2018-09-24', '11:45:00', 3, '25687947', 'Se comunica usuaria con Cc. 27123982, preguntando por Albisec One, asesor toma datos de envÃ­o y contacto, realiza programaciÃ³n de domicilio . El asesor es cordial, brinda informaciÃ³n correspondiente al producto, tiene buen manejo de llamada y una dispociÃ³n de servicio. OM: Se sugiere realizar confirmaciÃ³n de pedido  a manera de resumen. Utilizar los guiones de finalizaciÃ³n de llamada establecidos. Realizar gestiÃ³n de OAI y gestiÃ³n de bolsa plÃ¡stica. No omitir la concentraciÃ³n del pedido en el momento de brindar informaciÃ³n del producto. NOTA: 0/60\r\n', 1, 4, '2018-09-28 11:58:56', '2018-10-12 13:37:46'),
	(3, 3, 9, 4, '2018-09-24', '13:20:00', 1, '25697417', 'Se comunica Sra. Maria Alejandra Sandino, con Cc. 1020720591; solicitando Similac Total confort IQ plus Et. 2, Cebion 50mg naranja blister, Sinutab plus NS caja 10 unidades  y Bisacodilo 5mg caja 10 unidades 3 cajas. El asesor tiene buena empatÃ­a con el usuario, hace una excelente gestiÃ³n  de OAI, manejo de tiempos y de llamada. MO: se sugiere realizar confirmaciÃ³n de pedido una vez se ha realizado la venta. NOTA: 0/100\r\n', 1, 4, '2018-09-28 12:12:57', '2018-10-12 13:37:46'),
	(4, 4, 21, 4, '2018-09-28', '08:14:00', 1, '25918654', 'Se comunica el Sr. Robinson Saldarriaga, con Cc 71218633. Hace solicitud de 6 bolsas de Salofalk Enema 4g/60ml. El asesor atiende la solicitud, brinda y resuelve dudas al respecto sobre el tema, es amable y tiene buen servicio. OM: confirmar pedido antes de finalizar la factura a manera de resumen, realizar gestiÃ³n del OAI, utilizar guion habeas data. Ofrecer Bolsa  y utilizar guion de despedida establecido.-NOTA: 0/60\r\n', 1, 4, '2018-09-29 15:39:42', '2018-10-12 13:37:46'),
	(5, 5, 17, 4, '2018-09-28', '08:51:00', 1, '25921779', 'Se comunica el Sr. Miguel Zarate con Cc17088115. Solicitando QUIRUCIDAL JABON 4%+1%+1% EMUL TOP FCO 1000ML, a lo cual la asesora le indica que solo manejamos de 500ml. Toma el pedido de forma adecuada, es cortes y Ã¡gil con el proceso, hace gestiÃ³n de productos OAI, y finaliza confirmando el pedido de forma correcta. OM; se sugiere al momento de finalizar la comunicaciÃ³n, hacerlo con los guiones establecidos NOTA 80/80', 1, 4, '2018-09-29 15:59:34', '2018-10-12 13:37:46'),
	(6, 6, 23, 4, '2018-09-28', '10:44:00', 1, '25970189', 'Observaciones: Se comunica la sra Blanca Gamboa con Cc 52093389, solicitando Losartan Potasico de 50mg lab AG 30 tabs 2 cajas, Noraver B 6mg tab Mast caja 12 tabs. Asesor es proactivo con el domicilio, informa del costo del mismo por la hora, atiende de manera Ã¡gil con buena disposiciÃ³n de servicio. OM: se recomienda confirmar a manera de resumen el pedido del  usuario, hacer gestiÃ³n del  OAI,  ofrecer bolsa plÃ¡stica. NOTA: 0/80 \r\n', 1, 4, '2018-09-29 16:19:36', '2018-10-12 13:37:46'),
